function App() {
  const array=[0,1,2,3,4,5]
  return (
    <div className="container">
    <Grid templateColumns="repeat(5, 1fr)" gap={6}>
    <Box w="100%" h="20" bg="tomato" />
    <Box w="100%" h="20" bg="tomato" />
    <Box w="100%" h="20" bg="tomato" />
    <Box w="100%" h="20" bg="tomato" />
    <Box w="100%" h="20" bg="tomato" />
  </Grid>
  </div>
  );
}

export default App;
